import Particles from "react-tsparticles";
import ParticlesConfig from "./config/particlesConfig.js";

const Particlebackground = () => {
  return (
    <Particles params={{
      particles: {
        number: {
          value: 200,
          density: {
            enable: true,
            value_area: 1000,
          }
        },
      },
    }}></Particles>
  );
}

export default Particlebackground;
